webpackJsonp([0x7f40c91f15df],{2993:function(e,o){e.exports={data:{talkJson:{description:"Google I/O 2009 - The Myth of the Genius Programmer\r\n\r\nBrian Fitzpatrick, Ben Collins-Sussman\r\n\r\nA pervasive elitism hovers in the background of collaborative software development:  everyone secretly wants to be seen as a genius.  In this talk, we discuss how to avoid this trap and gracefully exchange personal ego for personal growth and super-charged collaboration.  We'll also examine how software tools affect social behaviors, and how to successfully manage the growth of new ideas.\r\n\r\nFor presentation slides and all I/O sessions, please go to: code.google.com/events/io/sessions.html",meta:{duration:"PT55M17S"},presenter:{name:"Brian Fitzpatrick & Ben Collins-Sussman"},slug:"google-io-2009-the-myth-of-the-genius-programmer",source:{id:"0SARbwvhupQ",provider:"youtube"},tag:["google","Google I/O 2009"],title:"The Myth of the Genius Programmer"},allTalkJson:{edges:[{node:{description:"Linus Torvalds visits Google to share his thoughts on git, the source control management system he created two years ago.",meta:{duration:"PT1H10M15S"},presenter:{name:"Linus Torvalds"},source:{id:"4XpnKHJAok8",provider:"youtube"},slug:"linus-torvalds-about-git",tag:["google","git"],thumbnails:{default:{url:"https://i.ytimg.com/vi/4XpnKHJAok8/default.jpg",height:90,width:120}},title:"Linus Torvalds talks about GIT"}}]}},pathContext:{slug:"google-io-2009-the-myth-of-the-genius-programmer",tags:["google","Google I/O 2009"]}}}});
